車種別専用カット！ドレスアップに。<br><br><br> ●「マジカルカーボン・シリーズ」は炭素繊維素材、及びガラス繊維素材を特殊技術により柔軟性をもたせた国際特許申請済みの純国産の高級カーボンです。<br><br>●平織りカーボンではなく、見る角度によってその表情を変える綾織りカーボンにこだわっています。<br><br>●素材の輝きと光沢を放ちつつ、カーボンの立体感・質感が味わえ、高級感を醸し出しながらエレガンスに仕上がります。<br><br><br>【適合車種】<br>メーカー：NISSAN/ニッサン<br>車 名：GTR<br>型 式：CBA-35R<br>年 式：2007.12～<br><br>カラー：ブラック<br>メーカー：ハセプロ<br>品番：CPAN-1<br><br>※画像は装着イメージとなりますのでブラックと異なる場合がございます。<style type="text/css">
